import React from 'react';

import './App.css';
import Home from './components/pages/HomePage/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Menu from './components/pages/Mainpage/Menu';
import MenuforClient from './components/pages/MenuforClient';
import ContactUs from './components/pages/ContactUs';
import SignUp from './components/pages/HomePage/SignUp';
import LoginPage from './components/pages/HomePage/LoginPage';

function App() {
  return (
    <Router>
        {/* <Navbar/> */}
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/contact-us' component={ContactUs} />
          <Route path='/signup' component={SignUp} />
          <Route path='/login' component={LoginPage} />
          <Route path='/menu' component={Menu} />
          <Route path='/clientmenu' component={MenuforClient} />
        </Switch>
    </Router>
  );
}

export default App;
